from typing import List
class Solution:
    def numEnclaves(self, grid: List[List[int]]) -> int:
        connections={}
        count=0
        row, col=len(grid), len(grid[0])
        for i in range(1,row-1):
            for j in range(1,col-1):
                fourWayClosure=0
                if grid[i][j]:
                    if not grid[i][j-1]: fourWayClosure+=1  # left
                    else:
                        if (i,j) not in connections:   connections[(i,j)]=[(i,j-1)]
                        else:   connections[(i,j)].append((i,j-1))
                    if not grid[i][j+1]: fourWayClosure+=1  # right
                    else:
                        if (i,j) not in connections:   connections[(i,j)]=[(i,j+1)]
                        else:   connections[(i,j)].append((i,j+1))
                    if not grid[i-1][j]: fourWayClosure+=1  # top
                    else:
                        if (i,j) not in connections:   connections[(i,j)]=[(i-1,j)]
                        else:   connections[(i,j)].append((i-1,j))
                    if not grid[i+1][j]: fourWayClosure+=1  # down
                    else:
                        if (i,j) not in connections:   connections[(i,j)]=[(i+1,j)]
                        else:   connections[(i,j)].append((i+1,j))
                    if fourWayClosure==4:   count+=1
        
        for i in range(1,row-1):
            for j in range(1,col-1):
                if (i,j) in connections:
                    stack=set()
                    stack.add((i,j))
                    qualify=True
                    tempCount=0
                    while stack:
                        index=stack.pop()
                        if (not index[0] or index[0]==row-1) or (not index[1] or index[1]==col-1) and qualify:
                            qualify=False
                        if index in connections:
                            stack.update(connections[index])
                            connections.pop(index)
                            tempCount+=1
                    if qualify:
                        count+=tempCount

        return count      





